 // How to get started:
 // Here we explain how to compile the files.
 // 1. Install [node.js](https://nodejs.org/download/) (which includes npm)
 // 2. Open your Terminal / Command Prompt and run the following commands:
 //  - Run `npm install -g browserify@17.0.0 uglify-js@3.12.1` to install global dependencies on your machine for the first time
 //  - Change directory to this folder: `cd my/path/to/bundles`
 //  - Run `npm init` to setup a simple `package.json` file; you can also manually create it and put the following as its content: `{ "name": "f8component-utils" }`
 //  - Run `npm install --save-dev @babel/core@7.22.5 @babel/preset-env@7.22.5 babelify@10.0.0` to install dependencies
 //  - Run `browserify f8component-utils.js -o f8component-utils.min.js -t [ babelify --presets [ @babel/preset-env ] ] && uglifyjs f8component-utils.min.js -o f8component-utils.min.js` to compile the final file
 // 3. Feed your html files with `f8component-utils.min.js` and you're good to go.




